import React from 'react'
import Nav from './Nav';

function User() {
    const ticket = [{name:"All Tickets",to:"/user"}, {name:"Add Ticket", to:"/user/addTicket"}];
    const profile = [{name:"Change Password"}, {name:"Logout"}];
    const elements = [
      {
        name: "Ticket",
        value: ticket,
      },
      {
        name: "Profile",
        value: profile,
      },
    ];
  
    
  
    
    return (
      <>
       
        <Nav tag={elements} />
         <Outlet></Outlet></>
      
    );
}

export default User
